import React from 'react';
import './App.css';
import Home from './components';

function App() {
  return (
    <div className="App">
      <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/about">
            <About />
          </Route>
          <Route path="/dashboard">
            <Dashboard />
          </Route>
        </Switch>
    </div>
  );
}

export default App;
